import "./App.css";
import Index from "./Pages/Index";
import Login from "./Pages/Login";
import { BrowserRouter, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/home" component={<Index />} />
          <Route path="/" component={<Login />} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
